import classes from './HeaderLeft.module.css';
import {Link} from 'react-router-dom';

import companyLogo from './img/logoBlueWhite.PNG'

function HeaderLeft(){

return (

 <div className={classes.headerLeft} > 

      <span className={classes.helper}></span><img className={classes.logo} src={companyLogo} alt='edr Logo' /> 
      <a href="#phys" class="icon1"> <i> Quantum Mechanics-I <sup>[IIT BBS]</sup></i></a>


  </div>

);


}

export default HeaderLeft;
